package com.nivyox.gamemanager.utils;

import lombok.Getter;

public enum SkinType {

    ZOMBIE("", ""),
    PIGMAN("", "");

    @Getter
    private String value;
    @Getter
    private String signature;

    SkinType(String value, String signature) {
        this.value = value;
        this.signature = signature;
    }
}
